import{_ as s,o as e,c as a,R as n}from"./chunks/framework.SqDegG6f.js";const w=JSON.parse('{"title":"windows下常见命令","description":"","frontmatter":{"title":"windows下常见命令","tags":["linux","windows"],"categories":["linux","windows"]},"headers":[],"relativePath":"windows/01.windows操作系统查看端口占用.md","filePath":"windows/01.windows操作系统查看端口占用.md","lastUpdated":1709629641000}'),i={name:"windows/01.windows操作系统查看端口占用.md"},t=n('<p>Windows下查看进程及结束进程命令</p><p>1)查看占用8080端口的进程号</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>netstat –aon | findstr “1080&quot;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>结果：TCP 0.0.0.0:8080 0.0.0.0:0 LISTENING 3500</p><p>可知，进程号为3500的进程占用了8080端口</p><p>可以使用命令 tasklist | findstr “3500”进一步查看3500进程的具体信息。</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>tasklist | findstr “3500”</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>结果：javaw.exe 3500 Console 0 28,792 K</p><p>可知3500进程为javaw.exe。</p><p>2）杀掉进程</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span> tskill 3500</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div>',11),p=[t];function d(o,l,r,c,_,u){return e(),a("div",null,p)}const m=s(i,[["render",d]]);export{w as __pageData,m as default};
